import React, { useState } from 'react'

const AddLaborantComponent = () => {

    const [laborantName, setlaborantName] = useState('')
    const [laborantSurname, setlaborantSurname] = useState('')
    const saveLaborant = (e) =>{
        e.preventDefault();

        const laborant = {laborantName, laborantSurname}

        console.log(laborant);
    }
  return (
    <div>
      <div className="container">
        <div className="row">
            <div className="card col-md-6 offset-md-3 offset-md-3">
                <h2 className="text-center">Add Laborant</h2>
                <div className="card-body">
                    <form>
                        <div className="form-group mb-2">
                            <label className="form-label">First Name : </label>
                            <input type="text" 
                            placeholder = "Enter first name"
                            name = "firstName"
                            className = "form-control"
                            value={laborantName}
                            onChange={(e) => setlaborantName(e.target.value)}
                            >
                            </input>
                        </div>
                        <div className = "form-group mb-2">
                            <label className = "form-label"> Last Name :</label>
                            <input
                            type = "text"
                            placeholder = "Enter last name"
                            name = "Surname"
                            className = "form-control"
                            value = {laborantSurname}
                            onChange = {(e) => setlaborantSurname(e.target.value)}
                            >
                            </input>
                        </div>
                        <button className = "btn btn-success" onClick = {(e) => saveLaborant(e)} >Submit </button>
                    </form>
                </div>
            </div>
        </div>
      </div>
    </div>
  )
}

export default AddLaborantComponent
